', 161, 6, N'6', N'The Avengers', N'System.Collections.Generic.List`1[System.String]', N'The Avengers is a British television series created in the 1960s. The Avengers initially focused on Dr. David Keel and his assistant John Steed. Hendry left after the first series and Steed became the main character, partnered with a succession of assistants. Steed''s most famous assistants were intelligent, stylish and assertive women: Cathy Gale, Emma Peel, and later Tara King. Later episodes increasingly incorporated elements of science fiction and fantasy, parody and British eccentricity.', 54.165, N'http://image.tmdb.org/t/p/w500/qZr7WAHgjd5J517XwZY6yEKWZjF.jpg', N'None', N'None', N'None', N'System.Collections.Generic.List`1[TMDbLib.Objects.Search.SearchTvSeason]', N'None', N'Ended', N'None', N'Scripted', N'https://www.youtube.com/watch?v=LBYhUvffPYs', 7.9, 68)
