', 26, 2, N'2', N'The New Avengers', N'System.Collections.Generic.List`1[System.String]', N'The New Avengers is a British secret agent fantasy adventure television series produced during 1976 and 1977. It is a sequel to the 1960s series, The Avengers and was developed by original series producers Albert Fennell and Brian Clemens.

The series was produced by The Avengers Enterprises Ltd for the ITV network, cost £125,000 per episode to produce at Pinewood Studios in England and was seen in 120 countries.

A joint United Kingdom-France-Canada production, the series picks up the adventures of John Steed as he and his team of "Avengers" fight evil plots and world domination. Whereas in the original series Steed had almost always been partnered with a woman, in the new series he had two partners: Mike Gambit, a top agent, crack marksman and trained martial artist, and Purdey, a former trainee with The Royal Ballet who was an amalgam of many of the best talents from Steed''s female partners in The Avengers.', 10.151, N'http://image.tmdb.org/t/p/w500/kAGQzhdPApR6fpJw7GZbxwEJoRs.jpg', N'None', N'None', N'None', N'System.Collections.Generic.List`1[TMDbLib.Objects.Search.SearchTvSeason]', N'None', N'Ended', N'None', N'Scripted', N'https://www.youtube.com/watch?v=DVXJMpAvtXM', 6.8, 20)
