', 42, 5, N'5', N'Rick and Morty', N'System.Collections.Generic.List`1[System.String]', N'Rick is a mentally-unbalanced but scientifically-gifted old man who has recently reconnected with his family. He spends most of his time involving his young grandson Morty in dangerous, outlandish adventures throughout space and alternate universes. Compounded with Morty''s already unstable family life, these events cause Morty much distress at home and school.', 176.955, N'http://image.tmdb.org/t/p/w500/8kOWDBK6XlPUzckuHDo3wwVRFwt.jpg', N'None', N'None', N'None', N'System.Collections.Generic.List`1[TMDbLib.Objects.Search.SearchTvSeason]', N'None', N'Returning Series', N'None', N'Scripted', N'https://www.youtube.com/watch?v=WNhH00OIPP0', 8.7, 4274)
